//引入的不再是vue的构造函数,引入的是一个名为createApp的工厂函数
import { createApp } from "vue";
import App from "./App.vue";

// 创建应用实例对象 vue 实例
const app = createApp(App);
app.mount("#app"); //页面容器id body div app
